function setProductImages() {
    const _product = allProductsImages.find(
        (p) => p.productName === product.product_name
    );
    const data = product.imageData;
    // const data = _product.images_to_use;
    canvas_images.canvas_front =
        data[0] &&
        data[0].pos !== undefined &&
        _product.images[data[0].pos].image_url;
    canvas_images.canvas_back =
        data[1] && data[1].pos !== "" && _product.images[data[1].pos].image_url;
    canvas_images.canvas_sleeve_right =
        data[2] && data[2].pos !== "" && _product.images[data[2].pos].image_url;
    canvas_images.canvas_sleeve_left =
        data[3] && data[3].pos !== "" && _product.images[data[3].pos].image_url;

    getEl("thumbnail_front_input").value = data[0] ? data[0].pos : "";
    getEl("thumbnail_back_input").value = data[1] ? data[1].pos : "";
    getEl("thumbnail_sleeve_left_input").value = data[2] ? data[2].pos : "";
    getEl("thumbnail_sleeve_right_input").value = data[3] ? data[3].pos : "";
    if (canvas_images.canvas_front) {
        product.imageData[0].placement = _product.images[data[0].pos].placement;
        getEl("thumbnail_front").src = canvas_images.canvas_front;
        getEl("thumbnail_front").style.display = "block";
    } else getEl("thumbnail_front").style.display = "none";
    if (canvas_images.canvas_back) {
        product.imageData[1].placement = _product.images[data[1].pos].placement;
        getEl("thumbnail_back").src = canvas_images.canvas_back;
        getEl("thumbnail_back").style.display = "block";
    } else getEl("thumbnail_back").style.display = "none";
    if (canvas_images.canvas_sleeve_right) {
        product.imageData[2].placement = _product.images[data[2].pos].placement;
        getEl("thumbnail_sleeve_right").src = canvas_images.canvas_sleeve_right;
        getEl("thumbnail_sleeve_right").style.display = "block";
    } else getEl("thumbnail_sleeve_right").style.display = "none";
    if (canvas_images.canvas_sleeve_left) {
        product.imageData[3].placement = _product.images[data[3].pos].placement;
        getEl("thumbnail_sleeve_left").src = canvas_images.canvas_sleeve_left;
        getEl("thumbnail_sleeve_left").style.display = "block";
    } else getEl("thumbnail_sleeve_left").style.display = "none";
}

